import React from "react";

const FetchAllReports = ({ item }) => {
  return (
    <div className="card">
      <p>IR: {item.id} <img src = {item.thumbnailUrl}/></p>
      <p>Name: {item.title} </p>
    </div>
  );
};

export default FetchAllReports;
